- input: "TEXT\x1CC00044842\x1C.TEXT\x1C\x1CF3XA\x1CThe amendment is written in response
    to the Commission's preliminary review of the November Monthly Report.  All items
    under #1 have been addressed under the individual entries.  None of the entries
    listed meet the definition of federal election activity and items contained no
    express advocacy. #2.  We cannot find an expenditure under schedule B on the report
    that had a description of opposition research, therefore, we cannot respond to
    item 2.  #3. 2007 was a non-federal election year in PA.  The only candidates
    on the ballot in PA were state judiciary, county and local candidates running
    for office. No staff member of the Party of PA hit the threshold of spending 25%
    or greater of their time on federal election activity to be reported on line 30B
    in October. #4. Schedule H2 has been corrected to reflect the ratio of 44.3 federal
    and 55.7 non-federal for the Swann Pgh Event.  The non-federal account has not
    overpaid the federal account therefore a transfer correction is not necessary.
    \  #5. Templeton Potus Event activities were paid for with 100% federal dollars
    and reported on line 21B Schedule B. This should not have been listed on Schedule
    H2.  The entry has been deleted.  This was a generic party fundraising event.
    \ #6. All expenditures were clarified under their individual entries. #7. The
    100% Federal activity on Schedule H2 has been deleted."
